pragma solidity ^0.8.0;

contract PostFilter {

    struct VerificationResult {
        bool exists;
        uint filtersPoolID;
    }


    bytes32[] private postFiltersPool;
    uint private lastPostPoolPageID;
    uint private postID;

    uint private constant FILTER_POOL_SIZE = 5; // 블룸 필터 풀의 크기
    uint private constant POSTS_PER_BUNDLE = 2; // 묶음당 포스트 개수
    uint private constant MAX_POSTS_IN_POOL = FILTER_POOL_SIZE * POSTS_PER_BUNDLE; // 최대 포스트 개수
    uint private constant FILTER_SIZE = 256;
    uint private constant NUM_HASH_FUNCTIONS = 7;
    
    constructor() {
        postFiltersPool.push(0); // 초기 필터 추가
        lastPostPoolPageID = 0;
        postID = 0;
    }

    function addItem(bytes memory postHash) public returns (uint) {
        postID++;
        uint postBundleID = (postID - 1) / POSTS_PER_BUNDLE + 1;
        uint filterIndex = (postBundleID - 1) % FILTER_POOL_SIZE;

        bytes32 filter = postFiltersPool[filterIndex];

        for (uint i = 0; i < NUM_HASH_FUNCTIONS; i++) {
            uint hash = uint(keccak256(abi.encodePacked(postHash, i))) % FILTER_SIZE;
            filter |= (bytes32(uint(1) << hash));
        }

        postFiltersPool[filterIndex] = filter;
        
        if(postID % POSTS_PER_BUNDLE == 0)
            postFiltersPool.push(0);

        if (postID % MAX_POSTS_IN_POOL == 0)
            resetFilters(); // 배열 초기화
        

        return postID;
    }

    function isItemExist(uint _postID, bytes memory item) public view returns (VerificationResult memory) {
        VerificationResult memory result;
        uint postBundleID = (_postID - 1) / POSTS_PER_BUNDLE + 1;
        uint filterIndex = (postBundleID - 1) % FILTER_POOL_SIZE;

        if (postID <= lastPostPoolPageID * MAX_POSTS_IN_POOL) {
            result.exists = false;
            result.filtersPoolID = _postID;
            return result;
        }

        bytes32 filter = postFiltersPool[filterIndex];
        
        for (uint j = 0; j < NUM_HASH_FUNCTIONS; j++) {
            uint hash = uint(keccak256(abi.encodePacked(item, j))) % FILTER_SIZE;
            if ((filter & (bytes32(uint(1) << hash))) == 0) {
                result.exists = false;
                result.filtersPoolID = 0;
                return result;
            }
        }

        result.exists = true;
        result.filtersPoolID = 0;
        return result;
    }

    function getFilters() public view returns (bytes32[] memory) {
        return postFiltersPool;
    }

    function getLastPostPoolPageID() public view returns (uint) {
        return lastPostPoolPageID;
    }

    function resetFilters() internal {
        delete postFiltersPool;
        postFiltersPool.push(0); // 초기 필터 추가
        lastPostPoolPageID++;
    }

    function resetAndAddItem(bytes memory item) public {
        resetFilters();
        addItem(item);
    }
}
